import React from "react";
class Test extends React.Component{
    constructor(props){
        super(props)
        this.state={
            id:1,
            name:"abc"
        };
    }
    render(){
        return(
            <div>
                <p>
                {this.state.id}
                {this.state.name}
                </p>
            </div>
        )
    }


}

export default Test;
